import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";

export default function AddType() {
  const [formData, setFormData] = useState({
    name: "",
    category: ""
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
   
  };

  return (
    
    //
    <div className="container my-4 px-2">
  <div className="row justify-content-center">
    <div className="col-12 col-sm-10 col-md-8 col-lg-6">
      <div className="card shadow-sm border-0">
        
        {/* Header */}
        <div className="card-header bg-light text-black text-center">
          <h5 className="mb-0">Add Product Type</h5>
        </div>

        {/* Body */}
        <div className="card-body">
          <form onSubmit={handleSubmit}>
            
            {/* Type Name */}
            <div className="mb-3">
              <label className="form-label fw-semibold">Type Name</label>
              <input
                type="text"
                className="form-control"
                name="name"
                placeholder="e.g. Shirt, T-Shirt"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>

            {/* Category */}
            <div className="mb-4">
              <label className="form-label fw-semibold">Category</label>
              <select
                className="form-select"
                name="category"
                value={formData.category}
                onChange={handleChange}
                required
              >
                <option value="">Select Category</option>
                <option value="Men">Men</option>
                <option value="Women">Women</option>
                <option value="Child">Child</option>
              </select>
            </div>

            {/* Button */}
            <button type="submit" className="btn btn-dark w-100">
              Add Type
            </button>

          </form>
        </div>

      </div>
    </div>
  </div>
</div>

  );
}
